YUI.add("autocomplete-filters-accentfold",function(D){var C=D.Text.AccentFold,A=D.Text.WordBreak,B=D.Array,E=D.Object;D.mix(D.namespace("AutoCompleteFilters"),{charMatchFold:function(H,G){var F=B.unique(C.fold(H).split(""));return B.filter(G,function(I){var J=C.fold(I.text);return B.every(F,function(K){return J.indexOf(K)!==-1;});});},phraseMatchFold:function(G,F){G=C.fold(G);return B.filter(F,function(H){return C.fold(H.text).indexOf(G)!==-1;});},startsWithFold:function(G,F){G=C.fold(G);return B.filter(F,function(H){return C.fold(H.text).indexOf(G)===0;});},wordMatchFold:function(H,F){var G=A.getUniqueWords(C.fold(H));return B.filter(F,function(I){var J=B.hash(A.getUniqueWords(C.fold(I.text)));return B.every(G,function(K){return E.owns(J,K);});});}});},"@VERSION@",{requires:["array-extras","text-accentfold","text-wordbreak"]});